import React from 'react';
import logo from './logo.svg';
import './App.css';
import Matrix from './matrix/Matrix';


function App() {
  var data = [
  [{value:0},{value:1},{value:2}],
  [{value:3},{value:4},{value:5}],
  [{value:6},{value:7},{value:8}],
]

  return (
    <div className="App">
      <div className="matrix">
        <Matrix data={data}/>
      </div>
    </div>
  );
}

export default App;
